import React from "react";
import './App.css';
import Login from './images/user.png'

const App = () => {
  return (
    <div className="container">
      <span className="Logo">
        <span>Logo</span>
      </span>
      <span className="navigatorBtn">
        <span className="HomeBtn">Home</span>
        <span className="InvestmentBtn">Investment</span>
        <span className="About_UsBtn">About Us</span>
        <span className="Contact_UsBtn">Contact Us</span>
      </span>
      <span className="Account">
        <span className="AccountBtn">Account</span>
        <a href="#" className="LoginBtn">
          <Login/>
        </a>
      </span>
    </div>
  );
};

export default App;
